css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("developers.freshbooks.com") {
  body {
    background: #222 !important;
    color: #bbb !important;
  }
  body #container {
    background: #1a1a1a !important;
  }
  .shadow, .shadow-top, .shadow-bottom {
    background: transparent !important;
  }
  .shadow-top, .shadow-bottom {
    display: none !important;
  }
  .box-rounded-sidebar {
    border-color:#444 !important;
  }
  #menu {
    background: #0D83DD !important;
    border-radius: 4px;
  }
  a:link, a:active, a:visited {
    color: #0D83DD !important;
  }
  #menu a {
    color: #fff !important;
  }
  #footer {
    background: transparent !important;
  }
  .footer-bottom {
    background: #1a1a1a !important;
    border-radius: 4px;
  }
  #menu ul.menu-main li a.homemenu:hover {
    background: #0877CB !important;
  }
  .phoneus, .footer-top.ostriches {
    display:none;
  }
  h2, h3, h4 {
    color: #bbb !important;
  }

  .dp-highlighter {
    background: #222 !important;
  }
  .dp-highlighter .tools {
    background: #333 !important;
  }
  .dp-highlighter ol li span:not([class]) {
    color: #bbb !important;
  }
  .dp-highlighter ol li, .dp-highlighter .columns div {
    background: #2a2a2a !important;
    color: #bbb !important;
  }
  .dp-highlighter ol li.alt {
    background: #222 !important;
  }

  .logo a {
    background: url(data:image/png;base64,) no-repeat scroll left bottom transparent !important;
  }
  .logo a:hover {
    background-position: left 1px !important;
  }
}
